drop database if exists MN_Clients_db;

create database MN_Clients_db;
use MN_Clients_db;

create table MN_Clients (
	id INT,
	State VARCHAR(50),
	lng VARCHAR(50),
	lat VARCHAR(50),
	gender VARCHAR(50),
	City VARCHAR(50),
	PostalCode VARCHAR(50),
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	Phone VARCHAR(50)
);
